let text = " GG ";

 async function getContestData(){
  fetch('https://kontests.net/api/v1/all')
  .then((res) => res.json())
  .then((data) => {
    return data;
  })
}

function App() {
  const data = getContestData();
  data.then(dat => console.log(dat[0].name));
}

export default App;
